import React from 'react';
import img from '../assets/home-bg.jpeg';

function Home() {
  return (
    <div class="relative isolate overflow-hidden h-screen w-screen arie-hidden">
      <img className='flex object-cover' src={img} alt="bg home"/>
    <div className="flex absolute w-full h-full bg-gray-900">
      <h1 className="text-4xl font-bold mb-4 text-slate-400">Welcome</h1>
    </div>
    </div>
  );
}

export default Home;
